import Card from './Card';
import './index.css';
import Card_data from './Card_data';

function App() {
  return (
    <>
      <h1 className="heading">TOP RATED NETFLIX SERIES</h1>
      <Card
        img_src = {Card_data[0].img_src}
        org_name = {Card_data[0].org_name}
        ser_name = {Card_data[0].ser_name}
        button = {Card_data[0].button}
      />
      <Card
        img_src = {Card_data[1].img_src}
        org_name = {Card_data[1].org_name}
        ser_name = {Card_data[1].ser_name}
        button = {Card_data[1].button}
      />
      <Card
        img_src = {Card_data[2].img_src}
        org_name = {Card_data[2].org_name}
        ser_name = {Card_data[2].ser_name}
        button = {Card_data[2].button}
      />

    </>
  );
}

export default App;
